import React from 'react';
import { CardSlide } from 'react-card-slide/dist';
import portfolio from "../Images/portfolio.JPG";
import { useProjectsContext } from "../Utils/ProjectsContext"


export default function Slides() {

    const [state, dispatch] = useProjectsContext();
    return (
        <div className="CardSlides">
            <h1>Recent Projects</h1>

            <CardSlide items={[{
                cardName: 'Card Name',
                cardDescription: 'Description',
                cardTotal: 0,
                showBodyImage: true,
                bodyImage: portfolio
            }, {
                cardName: 'Card Name 2',
                cardDescription: 'Description 2',
                cardTotal: 1,
                showBodyImage: true,
                bodyImage: portfolio
            }, {
                cardName: 'Carde Name 3',
                cardDescription: 'Description 3',
                cardTotal: 2,
                showBodyImage: true,
                bodyImage: portfolio
            }]} />

        </div>
    )
}
